import {
  convertToCSV,
  replacer,
  generateCSVRow,
  generateCSVHeaders
} from './convertToCsv'

describe('replacer', () => {
  it('should replace null value with empty string', () => {
    const value = null

    const result = replacer(value)

    expect(result).toEqual('')
  })

  it('should leave non-null primitive value unaltered', () => {
    const value = 1

    const result = replacer(value)

    expect(result).toEqual(value)
  })

  it('should leave non-null object value unaltered', () => {
    const value = {}

    const result = replacer(value)

    expect(result).toEqual(value)
  })
})

describe('convertToCsv', () => {
  it('should convert an empty array to CSV', () => {
    const data: any[] = []
    const expectedResult = ''

    const result = convertToCSV(data)

    expect(result).toEqual(expectedResult)
  })

  it('should convert a simple object to CSV', () => {
    const data: any[] = [{ foo: 'bar' }, { foo: 'baz' }]
    const expectedResult = `foo:$3.\r\nbar\r\nbaz`

    const result = convertToCSV(data)

    expect(result).toEqual(expectedResult)
  })

  it('should include the length of the longest value in the column header', () => {
    const data: any[] = [{ foo: 'bar' }, { foo: 'foobar' }]
    const expectedResult = `foo:$6.\r\nbar\r\nfoobar`

    const result = convertToCSV(data)

    expect(result).toEqual(expectedResult)
  })

  it('should throw an error when a column contains mixed types', () => {
    const data: any[] = [{ foo: 'bar' }, { foo: 123 }]

    expect(() => convertToCSV(data)).toThrowError(
      `Row (2), Column (foo) has mixed types.`
    )
  })

  it('should throw an error when a column contains a value that is too long', () => {
    const data: any[] = [{ foo: 'bar' }, { foo: longString }]

    expect(() => convertToCSV(data)).toThrowError(
      'The max length of a string value in SASjs is 32765 characters.'
    )
  })
})

describe('generateCSVHeaders', () => {
  it('should generate headers in the correct format for string data', () => {
    const data = [{ foo: 'bar' }, { foo: 'baz' }]
    const expectedHeaders = ['foo:$3.']

    const headers = generateCSVHeaders(data)

    expect(headers).toEqual(expectedHeaders)
  })

  it('should generate headers in the correct format for number data', () => {
    const data = [{ foo: 123 }, { foo: 4 }]
    const expectedHeaders = ['foo:best.']

    const headers = generateCSVHeaders(data)

    expect(headers).toEqual(expectedHeaders)
  })
})

const longString =
  ''
